import styled from "styled-components";
import {IUserImageStyle} from "@customTypes/style.types";
import {device} from "@constants/mediaQuery.constants";
import {LoaderBackgroundWhite} from "@components/loaders/bottleLoader/bottleLoader.style";

export const UserImageStyle = styled.label<IUserImageStyle>`
  background-image: ${props => props.backgroundImage ? `url(${props.backgroundImage})` : 'url("data:image/svg+xml;base64,")'}; 
  width: 200px;
  height: 200px;
  border-radius: 50%;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  border: 2px solid black;
  cursor: pointer;
  position: relative;
  overflow: hidden;

  ${device.tablet`
      width: 150px;
      height: 150px;
      margin-bottom: 25px;
    `}

  &:after {
    content: '';
    background-image: url("data:image/png;base64,");
    position: absolute;
    background-size: 50px;
    background-repeat: no-repeat;
    background-position: center;
    background-color: rgba(0, 0, 0, 0.70);
    border-radius: 50%;
    width: 100%;
    height: 100%;
    opacity: 0;
    transition: 0.3s all ease-in-out;
  }

  &:hover {
    &:after {
      opacity: 1;
    }
  }
  
  img {
    position: absolute;
    overflow: hidden;
    clip: rect(1px, 1px, 1px, 1px);
    width: 1px;
    height: 1px;
    word-wrap: normal;
  }
  
  ${LoaderBackgroundWhite} {
    border-radius: 50%;
  }
`